import React from "react";

const ExpensesList = () => {
  let expenseExpressions = <p>Expenses is not funded</p>;
  // Checking the filtered array have data aur not....
  if (filteredExpenses.length > 0) {
    expenseExpressions = filteredExpenses.map((expense) => (
      <ExpenseItem
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
        key={expense.id}
      />
    ));
  }

  return <div></div>;
};

export default ExpensesList;
